    public List<String> findWords(char[][] board, String[] words) {
        TrieNodeService trieNodeService = new TrieNodeService();
        TrieNode dictionary = trieNodeService.getNewEmptyTrie();
        for (String word : words) trieNodeService.insertIntoTrie(dictionary, word);
        int size = board.length;
        Set<String> matchingWords = new LinkedHashSet<>();
        for (int i = 0; i < size; i++) {
            int vSize = board[i].length;
            for (int j = 0; j < vSize; j++) {
                boolean[][] visitedIndices = new boolean[size][vSize];
//                System.out.println("Starting again from "+i+","+j);
                findMatchingWords(dictionary, i, j, board, visitedIndices, matchingWords, "", size, vSize);
            }
        }
        return new ArrayList<>(matchingWords);
    }

    public void findMatchingWords(TrieNode trie,
                                  int i, int j, char[][] board,
                                  boolean[][] visitedIndices,
                                  Set<String> matchingWords,
                                  String wordMatchedTillNow,
                                  int size, int vSize) {
        if (i < 0 || i >= size || j < 0 || j >= vSize || visitedIndices[i][j]) {
            return;
        }
//        boolean[][] newVisitedIndices = visitedIndices;
//                new boolean[size][vSize];
//        for (int ii = 0; ii < size; ii++) {
//            for (int jj = 0; jj < vSize; jj++) {
//                visitedIndices[ii][jj] = visitedIndices[ii][jj];
//            }
//        }
//        if ("aaaaaaaaaaaaaaa".equals(wordMatchedTillNow)){
//            System.out.println("Alert");
//        }
        char currentChar = board[i][j];
        TrieNode nextNode = trie.children.get(currentChar);
        if (nextNode == null) {
            visitedIndices[i][j] = false;
//            System.out.println("Give Up, Nothing on this Side");
            return;
        }
        visitedIndices[i][j] = true;
        wordMatchedTillNow+=currentChar;
        if (nextNode.word) {
            matchingWords.add(wordMatchedTillNow);
//            System.out.println("Word Matched "+wordMatchedTillNow);
        }
        if (nextNode.children == null || nextNode.children.size() == 0) {
            visitedIndices[i][j] = false;
//            System.out.println("Reached Leaf");
            return;
        }
//        System.out.println("Matched Char: "+currentChar+ " coordinates: " +i+ "," +j+ " Matched till now: " + wordMatchedTillNow);
        if (i > 0 && !visitedIndices[i-1][j]) findMatchingWords(nextNode, i-1, j, board, visitedIndices, matchingWords, wordMatchedTillNow, size, vSize);
        if (i < size-1 && !visitedIndices[i+1][j]) findMatchingWords(nextNode, i+1, j, board, visitedIndices, matchingWords, wordMatchedTillNow, size, vSize);
        if (j > 0 && !visitedIndices[i][j-1]) findMatchingWords(nextNode, i, j-1, board, visitedIndices, matchingWords, wordMatchedTillNow, size, vSize);
        if (j < vSize-1 && !visitedIndices[i][j+1]) findMatchingWords(nextNode, i, j+1, board, visitedIndices, matchingWords, wordMatchedTillNow, size, vSize);
        visitedIndices[i][j] = false;
    }
