class TrieNode {
    Character character;
    Map<Character, TrieNode> children;
    boolean word;

    TrieNode(Character character, boolean word) {
        this.character = character;
        this.word = word;
    }
    TrieNode(Character character, boolean word, Map<Character, TrieNode> children) {
        this.character = character;
        this.word = word;
        this.children = children;
    }
}

class TrieNodeService {
    void insertIntoTrie(TrieNode node, String str) {
        if (str == null || str.length() == 0) return;
        char nextChar = str.charAt(0);
        if (node.children == null) node.children = new HashMap<>();
        TrieNode nextNode = node.children.get(nextChar);
        if (nextNode == null) {
            nextNode = new TrieNode(nextChar, false);
            node.children.put(nextChar, nextNode);
        }
        if (str.length() == 1) {
            nextNode.word = true;
        } else {
            insertIntoTrie(nextNode, str.substring(1));
        }
    }
    TrieNode getNewEmptyTrie () {
        return new TrieNode(null, false, new HashMap<>());
    }
}